import React, { useState } from 'react';
import { Link, BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './dashboard.css'; // Import the CSS file
import AddCar from './Pages/AddCar';
// import ChangeOwner from './Pages/ChangeOwner';
import FabCar from './Pages/FabCar'; // Assuming FabCar is the Home/Dashboard component

const Dashboard = () => {
  const [showSearchBar, setShowSearchBar] = useState(false);

  const toggleSearchBar = () => {
    setShowSearchBar(!showSearchBar);
  };

  return (
    <Router>
      <nav className="navbar">
        <ul className="nav-list">
          <li>
            <Link to="/dashboard" className="nav-link">
              FabCar
            </Link>
          </li>
          <li>
            <Link to="/addCar" className="nav-link">
              Add Car
            </Link>
          </li>
          <li>
            <Link to="/changeOwner" className="nav-link">
              Change Owner
            </Link>
          </li>
          <li>
            <button className="nav-link search-btn" onClick={toggleSearchBar}>
              Search Cars
            </button>
          </li>
        </ul>
        {showSearchBar && (
          <div className="search-bar">
            <input type="text" placeholder="Search cars..." />
            <button className="search-btn">Search</button>
          </div>
        )}
      </nav>
      <Routes>
        <Route path="/dashboard" element={<FabCar />} />
        <Route path="/addCar" element={<AddCar />} />
        <Route path="/changeOwner" element={<ChangeOwner />} />
      </Routes>
    </Router>
  );
};

export default Dashboard;
